import "./Style.css";
import { Link } from "react-router-dom"

function NavbarAdmin() {
  return (
    <div className="navbar">
        <Link to="/admin/profiles">Listar Perfis</Link>
        <Link to="/admin/create">Cadastrar Perfil</Link>
        <Link to="/admin/Repo">Listar Repo</Link>
    </div>
  );
}

export default NavbarAdmin;
